          <div class="row s24996D">
            <div class="column large-12 x7D62B0">
              <p class="copy helvetica-neue p935A63 channel-custom-font-custom-12-sosumi"><span style="font-weight: 500;" class="">Display: </span>The display has rounded corners that follow a beautiful curved design, and these corners are within a standard rectangle. When measured as a standard rectangular shape, the screen is 13.76 centimetres / 5.42 inches (iPhone&nbsp;13&nbsp;mini), 15.40 centimetres / 6.06 inches (iPhone&nbsp;13, iPhone&nbsp;13&nbsp;Pro) or 16.95 centimetres / 6.68 inches (iPhone&nbsp;13&nbsp;Pro&nbsp;Max) diagonally. Actual viewable area is less.</p>
            </div>
          </div>
          <div class="row nFFE405">
            <div class="column large-12 pC1EF5E">
              <p class="copy helvetica-neue k18CC50 channel-custom-font-custom-12-sosumi"><span style="font-weight: 500;" class="">Water resistance: </span>iPhone&nbsp;13&nbsp;Pro, iPhone&nbsp;13&nbsp;Pro&nbsp;Max, iPhone&nbsp;13 and iPhone&nbsp;13&nbsp;mini are splash, water and dust resistant, and were tested under controlled laboratory conditions with a rating of IP68 under IEC standard 60529 (maximum depth of 6 metres up to 30 minutes). Splash, water and dust resistance are not permanent conditions, and resistance might decrease as a result of normal wear. Do not attempt to charge a wet iPhone; refer to the user guide for cleaning and drying instructions. Liquid damage is not covered under warranty.</p>
            </div>
          </div>
          <div class="row b3C2701">
            <div class="column large-12 x8D3CBC">
              <p class="copy helvetica-neue kAF6BC2 channel-custom-font-custom-12-sosumi"><span style="font-weight: 500;">Low-light photography: </span>Up to 2.2x better low-light performance using Wide camera on iPhone&nbsp;13&nbsp;Pro and iPhone&nbsp;13&nbsp;Pro&nbsp;Max (compared with the previous generation).</p>
            </div>
          </div>
          <div class="row pD8700A">
            <div class="column large-12 j228236">
              <p class="copy helvetica-neue v9AD445 channel-custom-font-custom-12-sosumi"><span style="font-weight: 500;">Capacity:</span> Available space is less and varies due to many factors. A standard configuration uses approximately 11GB to 14GB of space (including iOS and pre-installed apps) depending on the model and settings. Pre-installed apps use about 4GB, and you can delete these apps and restore them. Storage capacity subject to change based on software version and may vary by device.</p>
            </div>
          </div>
